private static String[] toTimestampStrs(long[] timestamps) {
  if (timestamps == null) {
    return null;
  }
  String[] result = new String[timestamps.length];
  for(int i=0; i < timestamps.length; ++i) {
    result[i] = Long.toString(timestamps[i]);
  }
  return result;
}
